NS_IMETHODIMP mozC02gestsea::GetStringPref(const char * aPref, nsAString & aValue)
{
  char * pcPref;
  nsresult rv;
  nsCOMPtr<nsIPrefService> pPrefService = do_GetService(NS_PREFSERVICE_CONTRACTID, &rv);
  NS_ENSURE_SUCCESS(rv,rv);
  nsCOMPtr<nsIPrefBranch> pPrefs = do_QueryInterface(pPrefService);
  if (!pPrefs)
    return NS_ERROR_FAILURE;
  rv = pPrefs->GetCharPref(aPref, &pcPref);
  NS_ENSURE_SUCCESS(rv,rv);
  aValue = NS_ConvertASCIItoUTF16(pcPref);
  return NS_OK;

}

