NS_IMETHODIMP mozC02gestsea::DisplayStep(mozIC01step * aStep)
{
  nsresult rv;
  nsAutoString pMasterIndex,pKey;
  PRUint32 pIndex;
  rv = aStep->Get(pMasterIndex, &pIndex, pKey);
  NS_ENSURE_SUCCESS(rv, rv);
  rv = mMasterDeck->SetAttribute(NS_LITERAL_STRING("selectedIndex"), pMasterIndex);
  NS_ENSURE_SUCCESS(rv, rv);
  mDontSaveStep = PR_TRUE;
  switch(pIndex) {
    case 2: rv = DetailBasePartenaireContactSelect(pKey); break;
    case 5: rv = DetailBasePartenaireObservationSelect(pKey); break;
    case 8: rv = DetailBasePartenaireAttributSelect(pKey); break;
    case 11: rv = DetailGestionVentesCommandeSelect(pKey); break;
    case 14: rv = DetailGestionVentesCommandeSearch(pKey); break;
    case 15: rv = DetailGestionVentesCommandeLigneSelect(pKey); break;
    case 18: rv = DetailBasePartenaireSelect(pKey); break;
    case 21: rv = DetailBasePartenaireSearch(pKey); break;
  }
  NS_ENSURE_SUCCESS(rv, rv);
  mDontSaveStep = PR_FALSE;
  return NS_OK;
}

NS_IMETHODIMP mozC02gestsea::SaveStep(const nsAString & aMasterIndex, PRUint32 aIndex, const nsAString & aDetailKey)
{
  nsresult rv;
  PRInt32 i;
  nsAutoString pMasterIndex;
  nsCOMPtr<mozIC01step> pStep = do_CreateInstance(MOZ_C01STEP_CONTRACTID, &rv);
  NS_ENSURE_SUCCESS(rv, rv);
  rv = pStep->Set(aMasterIndex, aIndex, aDetailKey);
  NS_ENSURE_SUCCESS(rv, rv);
  for (i=mHistoryLast;i>mHistoryCurrent;i--)
    mHistory.RemoveObjectAt(i);
  mHistoryLast = mHistoryCurrent;
  mXULElementI0217d->SetAttribute(NS_LITERAL_STRING("disabled"), NS_LITERAL_STRING("true"));
  if (mHistoryCurrent>mHistoryMaximum-1) {
    mHistory.RemoveObjectAt(0);
    mHistory.AppendObject(pStep);
    mXULElementI0217d->SetAttribute(NS_LITERAL_STRING("disabled"), NS_LITERAL_STRING("true"));
  } else {
    mHistory.AppendObject(pStep);
    mHistoryCurrent++;
    if (mHistoryCurrent>mHistoryLast) mHistoryLast=mHistoryCurrent;
    if (mHistoryCurrent>0) mXULElementI0216d->RemoveAttribute(NS_LITERAL_STRING("disabled"));
  }
  return NS_OK;
}

NS_IMETHODIMP mozC02gestsea::Now()
{
  nsresult rv;
  if (mHistoryCurrent>=0) {
    rv = DisplayStep(mHistory[mHistoryCurrent]);
    NS_ENSURE_SUCCESS(rv, rv);
  }
  return NS_OK;
}

NS_IMETHODIMP mozC02gestsea::Back()
{
  nsresult rv;
  mHistoryCurrent--;
  if (mHistoryCurrent<=0) {
    mXULElementI0216d->SetAttribute(NS_LITERAL_STRING("disabled"), NS_LITERAL_STRING("true"));
    mHistoryCurrent=0;
  }
  if (mHistoryCurrent<mHistoryLast) mXULElementI0217d->RemoveAttribute(NS_LITERAL_STRING("disabled"));
  rv = DisplayStep(mHistory[mHistoryCurrent]);
  NS_ENSURE_SUCCESS(rv, rv);
  return NS_OK;
}

NS_IMETHODIMP mozC02gestsea::Forward()
{
  nsresult rv;
  mHistoryCurrent++;
  if (mHistoryCurrent>=mHistoryLast) {
    mXULElementI0217d->SetAttribute(NS_LITERAL_STRING("disabled"), NS_LITERAL_STRING("true"));
    mHistoryCurrent=mHistoryLast;
  }
  if (mHistoryCurrent>0) mXULElementI0216d->RemoveAttribute(NS_LITERAL_STRING("disabled"));
  rv = DisplayStep(mHistory[mHistoryCurrent]);
  NS_ENSURE_SUCCESS(rv, rv);
  return NS_OK;
}

NS_IMETHODIMP mozC02gestsea::Home()
{
  mMasterDeck->SetAttribute(NS_LITERAL_STRING("selectedIndex"),NS_LITERAL_STRING("0"));
  return SaveStep(NS_LITERAL_STRING("0"),0,NS_LITERAL_STRING(""));
}

NS_IMETHODIMP mozC02gestsea::Init(nsIDOMWindowInternal * aWindow, PRBool * aSuccess)
{
  *aSuccess = PR_FALSE;
  nsresult rv;

  mHistoryCurrent=-1;
  mHistoryLast=-1;
  mHistoryMaximum=32;
  mDontSaveStep = PR_FALSE;
  mSOAPEncoding = do_CreateInstance(NS_SOAPENCODING_CONTRACTID, &rv);
  NS_ENSURE_SUCCESS(rv, rv);
  *aSuccess = PR_TRUE;

  nsCOMPtr<nsIPrompt> pPrompt= do_GetService(NS_DEFAULTPROMPT_CONTRACTID, &rv);
  NS_ENSURE_SUCCESS(rv,rv);

  mDOMWindowInternal = aWindow;
  if (mDOMWindowInternal) {
      rv = mDOMWindowInternal->GetDocument(getter_AddRefs(mDocument));
      NS_ENSURE_SUCCESS(rv,rv);
      if (mDocument) {
        rv = mDocument->GetElementById(NS_LITERAL_STRING("theMasterDeck"), getter_AddRefs(mMasterDeck));
        NS_ENSURE_SUCCESS(rv,rv);
      } else return NS_ERROR_FAILURE;
  } else return NS_ERROR_FAILURE;
  rv = InitPointers();
  NS_ENSURE_SUCCESS(rv,rv);
  rv = Home();
  NS_ENSURE_SUCCESS(rv,rv);
  nsAutoString pDatabase;
  rv = GetStringPref("gestsea.transport.uri", mTransportURI);
  if (NS_FAILED(rv)) {
    rv = pPrompt->Alert(ToNewUnicode(NS_LITERAL_CSTRING("Erreur")), ToNewUnicode(NS_LITERAL_CSTRING("Il n'est pas possible actuellement de rcuprer votre configuration de connexion.")));
    NS_ENSURE_SUCCESS(rv,rv);
    *aSuccess = PR_FALSE;
    return NS_ERROR_FAILURE;
  }
  rv = GetStringPref("gestsea.database", pDatabase);
  if (NS_FAILED(rv)) {
    rv = pPrompt->Alert(ToNewUnicode(NS_LITERAL_CSTRING("Erreur")), ToNewUnicode(NS_LITERAL_CSTRING("Il n'est pas possible actuellement de rcuprer votre configuration de connexion.")));
    NS_ENSURE_SUCCESS(rv,rv);
    *aSuccess = PR_FALSE;
    return NS_ERROR_FAILURE;
  }
  mSOAP = do_CreateInstance("@brice.fr/gestsea/C00gestsea;1", &rv);
  NS_ENSURE_SUCCESS(rv,rv);
  rv = mSOAP->SetTransportURI(mTransportURI);
  NS_ENSURE_SUCCESS(rv,rv);
  PRUnichar * pLogin=nsnull,* pPassword=nsnull;
  PRBool pCheck=PR_TRUE, pOK;
  pPrompt->PromptUsernameAndPassword(ToNewUnicode(NS_LITERAL_CSTRING("Connexion")), ToNewUnicode(NS_LITERAL_CSTRING("Veuillez saisir votre login et mot de passe.")), &pLogin, &pPassword, ToNewUnicode(NS_LITERAL_CSTRING("Connexion  la base '")+NS_ConvertUTF16toUTF8(pDatabase)+NS_LITERAL_CSTRING("' sur : ")+NS_ConvertUTF16toUTF8(mTransportURI)), &pCheck, &pOK);
  if (!pOK) {
    *aSuccess = PR_FALSE;
    return NS_OK;
  }
  nsString psLogin, psPassword;
  psLogin.Assign(pLogin);
  psPassword.Assign(pPassword);
  rv = mSOAP->Connect(psLogin, psPassword, pDatabase, mKey);
  if (NS_FAILED(rv)) {
    rv = pPrompt->Alert(ToNewUnicode(NS_LITERAL_STRING("Erreur de connexion")), ToNewUnicode(NS_LITERAL_STRING("Votre login ou votre mot de passe ou votre point de connexion est incorrect.")));
    NS_ENSURE_SUCCESS(rv,rv);
    *aSuccess = PR_FALSE;
    return NS_OK;
  }
  nsString pName, pUuid, pVersion, pState, pUserType;
  rv = mSOAP->Setup(mKey, pName, pUuid, pVersion, pState, pUserType);
  NS_ENSURE_SUCCESS(rv,rv);
  if (pUuid!=NS_LITERAL_STRING("94c4a73a-37d7-40af-b236-13cf291109fb")) {
    *aSuccess = PR_FALSE;
    rv = pPrompt->Alert(ToNewUnicode(NS_LITERAL_STRING("Erreur de connexion")), ToNewUnicode(NS_LITERAL_STRING("Le service web que vous voulez utiliser n'est pas le bon (")+pName+NS_LITERAL_STRING(").")));
    NS_ENSURE_SUCCESS(rv,rv);
    return NS_ERROR_FAILURE;
  }

  if (pVersion!=NS_LITERAL_STRING("1")) {
    *aSuccess = PR_FALSE;
    rv = pPrompt->Alert(ToNewUnicode(NS_LITERAL_CSTRING("Erreur de connexion")), ToNewUnicode(NS_LITERAL_CSTRING("La version de votre logiciel client est diffrente de celle du serveur que vous voulez utiliser.")));
    NS_ENSURE_SUCCESS(rv,rv);
    return NS_ERROR_FAILURE;
  }

  if (pState==NS_LITERAL_STRING("0")) {
    if (pUserType==NS_LITERAL_STRING("superuser")) {
      rv = pPrompt->Confirm(ToNewUnicode(NS_LITERAL_CSTRING("Base de donnes invalide")), ToNewUnicode(NS_LITERAL_CSTRING("La base de donnes utilise n'est pas  jour. Voulez-vous lancer une installation ?")), &pOK);
      if (pOK) {
        PRUnichar * puDatabase=ToNewUnicode(pDatabase);
        PRBool pForce;
        rv = pPrompt->Prompt(ToNewUnicode(NS_LITERAL_CSTRING("Base de donnes  initialiser")), ToNewUnicode(NS_LITERAL_CSTRING("Veuillez saisir le nom de la base de donnes  (crer si ncessaire et) initialiser.")),  &puDatabase, ToNewUnicode(NS_LITERAL_CSTRING("Forcer l'installation")), &pForce, &pCheck);
        if (pCheck) {
          PRUint32 pResult;
          pDatabase = puDatabase;
          rv = mSOAP->Init(mKey, pDatabase, pForce, &pResult);
          NS_ENSURE_SUCCESS(rv,rv);
          if (pResult==157 || pResult==159) {
            rv = mSOAP->Finish(mKey, &pResult);
            NS_ENSURE_SUCCESS(rv,rv);
            rv = mSOAP->Connect(psLogin, psPassword, pDatabase, mKey);
            if (NS_FAILED(rv)) {
              rv = pPrompt->Alert(ToNewUnicode(NS_LITERAL_STRING("Erreur de connexion")), ToNewUnicode(NS_LITERAL_STRING("Votre login ou votre mot de passe ou votre point de connexion est incorrect.")));
              NS_ENSURE_SUCCESS(rv,rv);
              *aSuccess = PR_FALSE;
              return NS_OK;
            }
            rv = mSOAP->Init(mKey, pDatabase, pForce, &pResult);
            NS_ENSURE_SUCCESS(rv,rv);
          }
        }
      } else {
        *aSuccess = PR_FALSE;
        return NS_ERROR_FAILURE;
      }
    } else {
      rv = pPrompt->Alert(ToNewUnicode(NS_LITERAL_CSTRING("Problme au niveau du Service Web")), ToNewUnicode(NS_LITERAL_CSTRING("La base de donnes que vous voulez utiliser n'est pas oprationnelle. Veuillez ressayer ultrieurement.")));
      *aSuccess = PR_FALSE;
      return NS_ERROR_FAILURE;
    }
  }

  return NS_OK;

}

NS_IMETHODIMP mozC02gestsea::Quit()
{
  nsresult rv;
  PRUint32 pResult;
  rv = mSOAP->Finish(mKey, &pResult);
  return rv;

}

