NS_IMETHODIMP mozC02gestsea::MenulistClear(nsIDOMXULElement * aMenupopup)
{
  nsresult rv;
  PRInt32 pCIndex;
  PRUint32 pLength;
  nsCOMPtr<nsIDOMNodeList> pChildNodes;
  nsCOMPtr<nsIDOMNode> pPopupNode, pNode, pUnusedNode;
  rv = aMenupopup->GetChildNodes(getter_AddRefs(pChildNodes));
  NS_ENSURE_SUCCESS(rv,rv);
  pChildNodes->GetLength(&pLength);
  for (pCIndex=pLength-1;pCIndex>=0;pCIndex--) {
    rv = pChildNodes->Item(pCIndex,getter_AddRefs(pNode));
    NS_ENSURE_SUCCESS(rv,rv);
    rv = aMenupopup->RemoveChild(pNode, getter_AddRefs(pUnusedNode));
    NS_ENSURE_SUCCESS(rv,rv);
  }
  return NS_OK;

}

